pragma solidity ^0.8.4;

//import "./TRR.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Tris is Ownable {

    
    constructor () { 
    }


    address public playerA ;
    address public playerB ;
    address public lastPlayed;
    address public winner;
    bool public gameOver;
    uint256 public turnsTaken;
    //uint8[] public moveTaken;
    //uint reward;
    uint session;
    address[] public gameBoard;

    struct Player {
        address user;
        bool turnIsFinished;
        uint16[] _playerMoves;
    }

    struct Players{
        address playerA;
        address playerB;

    }
    mapping(address => uint8[]) public playerMoves;

    /*struct PlayersMoves {
        address player;
        uint move;
    }
    
    PlayersMoves[] public player_moves;*/
    event GameStarted(address playerA, address playerB);

    function addReward(uint) internal {
       // .transferFrom(owner, address(this), 100);
    }
    function startGame(address _player1, address _player2) external {
    playerA = _player1;
    playerB = _player2;
    emit GameStarted(playerA, playerB);
    }  

    function yourMove(uint8 _move) public {
        require(!gameOver, "game is over");
        //require(_move != moveTaken , "Spot taken!");
        require(_move >= 1 && _move <= 9, "move invalid");
        require(msg.sender == playerA || msg.sender == playerB, "this player isn't playing");
        require(msg.sender != lastPlayed, "Not your turn.");

        turn();

 
        gameBoard.push(msg.sender);
        playerMoves[msg.sender].push(_move);
        lastPlayed = msg.sender;
        //moveTaken = _move;
        turnsTaken++;
    }

       /* if (isWinner(msg.sender)) {
            winner = msg.sender;
            gameOver = true;
        } else if (turnsTaken == 9) {
            gameOver = true;
        }

        
    

    function isWinner(address player) private view returns(bool) {

              

        //if (playerMoves[msg.sender] == )
        uint8[3][8] memory winningCombos = [
            [1,2,3],[4,5,6],[7,8,9],  // rows
            [1,4,7],[2,5,8],[3,6,9],  // columns
            [1,5,9],[3,5,7]           // diagonals
        ];
        
        for (uint i = 0; i < winningCombos.length; i++) {
            uint8[3] memory combo = winningCombos[i];
            if (
                gameBoard[combo[0]]==player &&
                gameBoard[combo[1]]==player &&
                gameBoard[combo[2]]==player
            ) {
                return true;
            }
            }
        
    }*/
    
    
    function turn() internal {
        if (block.timestamp > session && msg.sender == lastPlayed){
            revert();
        }
    }


        //emit Move(msg.sender, _move);
        


    function sendPrize() internal {

    }

    function getPlayersMoves() public view returns (uint8[] memory) {
        return playerMoves[msg.sender];
    }

}
